//pop右下角弹窗函数
var IsInitiatedPop = false;
var IsPoping = false;
function Pop(title, intro)
{
    if (!IsInitiatedPop && PageDynamicObject.hasOwnProperty("UserRemindMessageSetting") && (PageDynamicObject.UserRemindMessageSetting == null || PageDynamicObject.UserRemindMessageSetting.是否播放声音))
    {
        try
        {
            if (IsClientMode)
            {
                document.getElementById("SoundsDIV").innerHTML = "<embed name=\"Sounds\" id=\"Sounds\" src=\"Sounds/OnlineMessage.wav\" type=\"audio/x-wav\" hidden=\"true\" autostart=\"true\" loop=\"false\" ShowStatusBar=\"false\" ShowPositionControls=\"false\" EnableContextMenu=\"false\"></embed>";
            }
            else
            {
                document.getElementById("SoundsDIV").innerHTML = "<audio id=\"Sounds\"><source src=\"Sounds/OnlineMessage.wav\" type=\"audio/wav\" /></audio>";
            }
        }
        catch (e)
        { }
    }

    if (!IsPoping)
    {
        this.title = title;
        this.url = "";
        this.intro = intro;
        this.apearTime = 1000;
        this.hideTime = 500;
        this.delay = 10000;

        //添加信息
        this.addInfo();

        //显示
        this.showDiv();
    }
}

Pop.close = function ()
{
    IsPoping = false;
    $('#pop').hide();

    //马上再做一次查询，看是否有最新的提醒消息
    try
    {
        RemindMessageClass.LoadData();
    }
    catch (e)
    { }
};

Pop.prototype = {
    addInfo: function ()
    {
        //$("#popTitle a").attr('href', this.url).html(this.title);
        $("#popTitle").html(this.title);
        $("#popIntro").html(this.intro);
        //$("#popMore a").attr('href', this.url);
    },
    showDiv: function (time)
    {
        IsPoping = true;
        if (!($.browser.msie && ($.browser.version == "6.0") && !$.support.style))
        {
            //$('#pop').slideDown(this.apearTime).delay(this.delay).fadeOut(400);
            $('#pop').slideDown(this.apearTime);
        }
        else
        {
            //调用jquery.fixed.js,解决ie6不能用fixed
            $('#pop').show();
            jQuery(function ($j)
            {
                $j('#pop').positionFixed()
            })
        }

        if (PageDynamicObject.hasOwnProperty("UserRemindMessageSetting") && PageDynamicObject.UserRemindMessageSetting == null || PageDynamicObject.UserRemindMessageSetting.是否播放声音)
        {
            try
            {
                document.getElementById("Sounds").play();
            }
            catch (e)
            { }
        }

        if (PageDynamicObject.hasOwnProperty("UserRemindMessageSetting") && PageDynamicObject.UserRemindMessageSetting != null && PageDynamicObject.UserRemindMessageSetting.是否自动关闭)
        {
            //自动关闭
            window.setTimeout(function ()
            {
                Pop.close();
            }, PageDynamicObject.UserRemindMessageSetting.显示停留时间 * 1000);
        }
    }
};


